Information
------------------------------

Katie Pipers Extraordinary Births 
Charity activist and Bodyshockers presenter Katie Piper investigates some of
the many different ways modern women approach childbirth, meeting people who
sought ever-more unique means of delivery in a bid to secure their dream birth
experience. Among those she meets are expectant mothers who followed strict
fruitarian diets, a businesswoman who plans to gain the `post-birth glow' said
to have been achieved by the Duchess of Cambridge after the arrival of her two
children, and two mums-to-be who are seeking spiritualist ocean births in
Hawaii in the presence of wild dolphins, having already made use of crystals to
predict their due dates. As Katie's investigation progresses, she discusses the
pros and cons of each birth plan with a clinician, and catches up with the
ambitious parents to discover whether they were able to follow through with
their extravagant arrangements

